function App() {
    const props = useSpring({
        opacity: 5,
        from: {opacity:0},
        config:{mass:10, tension:1, friction: 1}

    })

    return  ( 
        <div>
            <div className="row ">
             <animated.img className="btn"src={logo} style={props}>
        </animated.img>
        </div>
        <animated.div style={props} className="viewport-header-about">
                    <Link className="launchTitle-about" to="./about">|    Flowers     |</Link>
                        <Link className="launchTitle-about" to="./portfolio">|    Styling     |</Link>

                        <Link className="launchTitle-about" to="./products">|   Installation  |</Link>
                </animated.div>
                <animated.div style={props} className="row">
                    <div className="col-md-2"></div>
                    <div className="col-md-8 about">
                    <h1>MEET BRENNA</h1>
                    <p>Brenna Cavanaugh was born and raised in the mountains of Sun Valley, Idaho.  The natural flora + fauna of the area have brought great inspiration into her unique style.  She has worked in the art and garden field for over 10 years from jewelry design, to large scale set design, sustainable farming, to being Ketchum Flower Companyâ€™s lead designer for 5 years.</p>
                        <img src={Img}></img>
                    </div>
                    <div calssName="col-md-2 about">
                    </div>
                </animated.div>
        </div>
    )

}

export default App;
